import React from 'react';
import "./App.css";


function Btn({name}){
  function clickMe({name}){
   console.log('{name}을 눌렀어')
  }
  return <button onClick = {clickMe}>
    {name}
  </button>
}

function LeftArea () {
  return (
    <div className = "left-area">
      <div className = "desin_system">
        Design
        System
        for ITRM
      </div>
      <div className = "style_guide">
        STYLE GUIDE
      </div>
      <div className = "style_guide_elements">
        <btn name = "color">Color</btn>
        Typography
        Icon
        Logo
      </div>
      <div className = "ui_component">
        UI Component
      </div>
      <div className = "ui_component_elements">
        Buttons
        Toggles
        Input Fields
        Dropdown Menus
        ToolTips & Markers
        Notifications
        Modals
        Empty States
        Date Pickers
        Grid List
        Data Tables
      </div>
    </div>
  );
}

function Contents(){
  return <div className = "content-area">
    ready to put somethings....
    </div>;
}

function App() {
  return(
      <div>
        <LeftArea />
        <Contents />
      </div>
    );
}

export default App;
